import {BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom'
import Home from './pages/Home';
import Odjeca from './pages/Odjeca';

function App() {
  return (
    <div className="App">
    <Router>
      <Link to="/odjeca"> Odjeca </Link>
      <Link to="/addOdjeca"> Dodajte novu vrstu odjece </Link>
      <Routes >
        <Route path='/' element={<Home/>} />
      </Routes >
    </Router>
    </div>
  );
}

export default App;
